INSERT INTO "Requirement_Item__c" VALUES(32,'True','False','True','','','','2020-09-17T16:07:03.000+0000','','','3.0','True','True','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i>Essays are recommended, but not required. </i> </br></br>
<b>Essay 2 Topic:</b></br></br>
It is important to St. Thomas that all members of our community understand our dedication to providing an inclusive living and learning environment. We would like to hear your observations and thoughts about diversity and inclusion based on what you have learned in your lifetime.</br></br>
<b><i>Please enter your essay in the space provided or upload it using the button below.</i></b></br></br>','','False','False','Essay 2','2020-09-22T19:02:50.000+0000','','Upload Essay 2(UGFR)','','','0128A000002zOPQQA2','','','','','','','','','Requirement_Item__c2020-1-2208:24:385dmm','','','','True','','','19');
INSERT INTO "Requirement_Item__c" VALUES(33,'True','False','True','','','','2020-09-17T16:07:03.000+0000','','','2.0','True','True','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i>Essays are recommended, but not required. </i> </br></br>
You may choose one of the topics described below or submit a paper you have written for class.  </br></br>
<b>Essay 1 Topics:</b></br></br>
1. Discuss a meaningful contribution you have made through involvement in school, church or community activities.</br>
2. Describe an event, a person or an educational experience that has had a major impact on your life and why.</br>
3. Share additional information about your personal story that would be beneficial to the application review process. What do you want the readers to know about you apart from courses, grades and test scores?</br></br>
<b><i>Please enter your essay in the space provided or upload it using the button below.</i></b></br></br>','','False','False','Essay 1','2020-09-22T19:02:58.000+0000','','Upload Essay 1(UGFR)','','','0128A000002zOPQQA2','','','','','','','','','Requirement_Item__c2020-1-1408:25:555Uvx','','','','True','','','19');
