INSERT INTO "Requirement_Item__c" VALUES(90,'True','False','False','','Started','','2021-03-01T18:43:27.000+0000','','','1.0','True','True','Started','','','','','','','We require a bachelor’s degree from a regionally accredited U.S. institution (or the international equivalent). Original transcripts are required from all undergraduate and graduate institutions you have attended, sent directly from the institution. If your institution offers electronic transcripts, please send them to Graduate Admissions (gradadmissions@stthomas.edu). Paper transcripts must be submitted in sealed envelopes and signed by the appropriate university official. These can be sent to:
University of St. Thomas
Graduate Records - Admissions
1000 LaSalle Ave., Box 5
Minneapolis, MN 55403-2005
Exception: Transcripts for advanced placement courses and study abroad transfer credits are not required.
